description:
What are the signs of the times? The book of Revelation shows us what must &quot;shortly&quot; come to pass. 

Join us tonight as we examine the nature of Bible prophecy and how it unfolds through time. But also personally, how does the Lord reveal things to you? Be blessed to take in Revelation: the reading, hearing and keeping the words of this book. Then be challenged to distribute: the good news of what Jesus has done!
Athey Creek Christian Fellowship is a body of believers in Wilsonville Oregon desiring to know the Lord in an ever-increasing measure. We are a non- denominational fellowship associating with all who are in the Body of Christ.  
